records.addlTxt:
Defendant Aaron A Chikowski in court with Attorney Kevin Michael Gaertner.  Abbey Nickolie and Law Intern Melissa Zilavy appeared for the State of Wisconsin.  Case called for plea and sentence.  Defendant enters a guilty plea to Count #1.  Court performs plea colloquy and finds Defendant guilty of Count #1.  Counts #2 & 3 are dismissed and read-in.  Count #4 is dismissed by operation of law.  State gives sentencing recommendations.  Attorney Gaertner makes statements regarding sentencing.  Defendant makes statements.  Court sentences the Defendant to the following:

COUNT #1:  IMPOSED AND STAYED SENTENCE OF:   

4 YEARS IMPRISONMENT (CREDIT -2 days)
  -  2 YEARS OF INITIAL CONFINEMENT
  -  2 YEARS OF EXTENDED SUPERVISION;

*D/L REVOCATION: 36 months.
*IGNITION INTERLOCK: 36 months.

TERM OF PROBATION:  3 YEARS;   **Transfer allowed to Green Lake County**

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol or illegal drugs 
*No Use or Possession of prescription drugs without a valid prescription;
*DNA sample to be provided if not yet previously done 
*Attend Victim Impact Panel on 2/18/15.  Defendant to serve 30 days huber, consecutive, as penalty for failure to attend Victim Impact Panel 

BLOOD DRAW FEE:  $35.00  (to be paid as a condition of probation - to be forward to City of New Berlin Police Department);

FINE:  $3,293.00 & $250.00 DNA surcharge (to be out of cash bail posted and remainder paid as a condition of probation);

CONDITION TIME:  12 MONTHS,  - Non-working hours with standard release conditions to commence forthwith-Defendant taken into custody. **Transfer allowed to Green Lake County**

Felony warnings, voting rights and firearms warnings given.
